import React, { memo } from 'react';

const Button = ({ type, style, onClick, title }) => {
	return (
		<div style={{ position: "relative" }}>
			<button
				type={type || 'button'}
				// style={style || {}}
				onClick={onClick}
			>
				{ title || 'title' }

			</button>
			<div className="loader" style={{ position: "absolute", width: 30, height: 30 }}/>
		</div>
	);
};

export default memo(Button, ( prevProps, nextProps ) => {
	return JSON.stringify(prevProps) === JSON.stringify(nextProps)
});
